import React from 'react'
import Header from "../users/Header";
import {CCard} from "@coreui/react";

const HelloWorld = (props) => {

  return (
    <>
      <Header state={props.state}/>
      <CCard>

        <h1>Hello, world!</h1>
      </CCard>
    </>
  )
}

export default HelloWorld;
